import Api from '../api';

const AuthHttp = {
    authUrl: '/auth',

    signup: (data) => {
        return Api.post(`${this.authUrl}/signup`, data);
    },

    signin: (data) => {
        return Api.post(`${this.authUrl}/signup`, data);
    }
}

export default AuthHttp;
